import React, { useState, useEffect } from 'react';
import { useSearchParams } from 'react-router-dom';
import axios from 'axios';
import './ComparePage.css';

interface Product {
  goodsId?: number;
  goodsName: string;
  goodsPrice: number;
  goodsLink: string;
  imgUrl?: string;
  mallType: number;
}

interface CompareGroup {
  goodsName: string;
  goodsList: Product[];
  lowestPrice: number | null;
  lowestPlatform?: string;
}

const ComparePage: React.FC = () => {
  const [searchParams] = useSearchParams();
  const [query, setQuery] = useState(searchParams.get('query') || '');
  const [compareGroups, setCompareGroups] = useState<CompareGroup[]>([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState<string | null>(null);

  // 实际API调用
  useEffect(() => {
    if (query.trim()) {
      searchProducts(query);
    }
  }, [query]);

  const searchProducts = async (searchQuery: string) => {
    setLoading(true);
    setError(null);

    try {
      // 实际API调用
      const response = await axios.post('http://localhost:9090/goods/compare', {
        query: searchQuery
      });
      setCompareGroups(response.data.data || []);
      setLoading(false);
    } catch (err) {
      setError('搜索失败，请稍后重试');
      setLoading(false);
      console.error(err);
    }
  };

  const handleSearch = (e: React.FormEvent) => {
    e.preventDefault();
    if (query.trim()) {
      searchProducts(query);
    }
  };

  const getPlatformName = (mallType: number): string => {
    switch (mallType) {
      case 10: return '乐天';
      case 20: return '雅虎';
      case 30: return '淘宝';
      default: return '未知平台';
    }
  };

  const getPlatformColor = (mallType: number): string => {
    switch (mallType) {
      case 10: return '#ff4400'; // 乐天
      case 20: return '#00a0e9'; // 雅虎
      case 30: return '#ff6600'; // 淘宝
      default: return '#666';
    }
  };

  return (
    <div className="compare-page">
      <div className="search-section">
        <form onSubmit={handleSearch} className="search-form">
          <input
            type="text"
            value={query}
            onChange={(e) => setQuery(e.target.value)}
            placeholder="输入商品名称进行比价..."
            className="search-input"
          />
          <button type="submit" className="search-button">搜索</button>
        </form>
      </div>

      {loading && <div className="loading">搜索中...</div>}
      {error && <div className="error">{error}</div>}

      {!loading && !error && compareGroups.length > 0 && (
        <div className="compare-results">
          <h2>比价结果</h2>
          {compareGroups.map((group, index) => (
            <div key={index} className="compare-group">
              <div className="group-header">
                <h3>{group.goodsName}</h3>
                {group.lowestPrice !== null && (
                  <div className="lowest-price">
                    <span>最低价: </span>
                    <span className="price">¥{group.lowestPrice}</span>
                    <span className="platform">({group.lowestPlatform})</span>
                  </div>
                )}
              </div>

              <div className="product-list">
                {group.goodsList.map((product, productIndex) => (
                  <div key={productIndex} className="product-item">
                    <div className="product-info">
                      <div className="product-image">
                        <img 
                          src={product.imgUrl || 'https://via.placeholder.com/100x100.png?text=产品'} 
                          alt={product.goodsName} 
                        />
                      </div>
                      <div className="product-details">
                        <h4>{product.goodsName}</h4>
                        <div className="price" style={{ color: getPlatformColor(product.mallType) }}>
                          ¥{product.goodsPrice}
                        </div>
                        <div className="platform" style={{ color: getPlatformColor(product.mallType) }}>
                          {getPlatformName(product.mallType)}
                        </div>
                      </div>
                    </div>
                    <div className="product-actions">
                      <a 
                        href={product.goodsLink} 
                        target="_blank" 
                        rel="noopener noreferrer"
                        className="buy-button"
                      >
                        去购买
                      </a>
                    </div>
                  </div>
                ))}
              </div>
            </div>
          ))}
        </div>
      )}

      {!loading && !error && compareGroups.length === 0 && query && (
        <div className="no-results">未找到相关商品</div>
      )}
    </div>
  );
};

export default ComparePage;
